import './App.css';
import MainNav from './components/MainNav';
import ProjectCard from './components/ProjectCard';

function App() {
  return (
    <div className="App">
      const Card = props => (
      <Panel {...props} bordered header="Card title">
        <Paragraph />
      </Panel>
    );

    const instance = (
      <Row>
        <Col md={6} sm={12}>
          <Card />
        </Col>
        <Col md={6} sm={12}>
          <Card />
        </Col>
        <Col md={6} sm={12}>
          <Card />
        </Col>
        <Col md={6} sm={12}>
          <Card />
        </Col>
      </Row>
    );

    ReactDOM.render(instance);
    </div>
  );
}

export default App;
